// src/components/BookReader.js
import React from 'react';
import { useParams } from 'react-router-dom';

const BookReader = () => {
    const { bookLink } = useParams();

    return (
        <div className="book-reader">
            <h2>Reading Book</h2>
            <iframe
                src={decodeURIComponent(bookLink)}
                title="Book Content"
                width="100%"
                height="600px"
                style={{ border: 'none' }}
            />
        </div>
    );
};

export default BookReader;
